  const functionToString = Function.prototype.toString;
  Function.prototype.toString = function () {
    let s;
    if (this.native) {
      s = this.native.toString();
    } else {
      s = functionToString.call(this);
    }
    return s;
  }
  Function.prototype.toString.native = functionToString;
