  function hookNativeFunction(proto, name, fn) {
    const backup = Object.getOwnPropertyDescriptor(proto, name);
    if (!backup) {
      return;
    }
    function hooker() {
      const args = Array.prototype.slice.call(arguments);
      return fn.call(this, backup.value, args);
    }
    hooker.native = backup.value;
    hooker.prototype = undefined;
    Object.defineProperty(proto, name, {
      value: hooker
    });
  }

  function hookNativeGet(proto, name, fn) {
    const backup = Object.getOwnPropertyDescriptor(proto, name);
    if (!backup) {
      return;
    }
    function hooker() {
      return fn.call(this, backup.get);
    }
    hooker.native = backup.get;
    hooker.prototype = undefined;
    Object.defineProperty(proto, name, {
      get: hooker,
      set: backup.set
    });
  }

