  hookNativeGet(HTMLElement.prototype, 'offsetWidth', function (offsetWidth) {
    let fontFamilies = this.style.fontFamily.split(",").map(f => f.trim()).filter(f => f.length > 0);
    let fontSize = this.style.fontSize;
    let width = offsetWidth.call(this);
    if (fontSize === '72px') {
      //特殊的判断逻辑, 这个72px就是用来检测字体的
      if (fontFamilies.length === 2 && basicFonts.indexOf(fontFamilies[1]) !== -1) {
        //如果有两个字体, 且后一个是标准字体, 就是用来检测字体存不存在的
        const basicFont = fontFamilies[1];
        const extraFont = fontFamilies[0].replaceAll(/["']/g, "");
        if (availableFonts[extraFont] && availableFonts[extraFont][basicFont]) {
          width = availableFonts[extraFont][basicFont].width;
        }
      }
    }
    return width;
  });
